Since $\angle ADB = 180^\circ - \angle ABD - \angle BAD = 180^\circ - \left(90^\circ - \frac{3\alpha}{2}\right) - \alpha = 90^\circ + \frac{\alpha}{2},$ triangle $ABD$ is isosceles, so $BD = AB.$  Then
\[\angle ABD = \angle BAD = \alpha.\]Hence, $\angle ABC = \angle BAD + \angle ABD = 2\alpha.$  Then
\[\angle ACB = \frac{180^\circ - \alpha}{2} = 2\alpha,\]so $\alpha = 36^\circ.$  Then $\angle BAC = 36^\circ,$ $\angle ABC = \angle ACB = 72^\circ,$ and
\[AB = AC = \frac{AM}{\sin \angle ABC} = \frac{11}{\sin 72^\circ}.\]Then
\[BC = 2 \cdot \frac{11}{\sin 72^\circ} \sin 72^\circ = \boxed{22}.\]

